INSERT INTO `courses` (`id`, `name`, `description`, `about_author`, `img_author`, `state`, `vimeo_id`, `free_video`, `file_path`, `resources`, `skills`, `video_uri`, `created_at`, `updated_at`, `video_path`, `area_id`, `programs_id`) VALUES
(50, 'Experimentar y Decidir', '<p>Desde la premisa de que cada uno de nosotros tiene el chip de la innovación incorporado, hasta ahora hemos recorrido un camino que involucra tanto a las personas que lo han reconocido, o se están dando la oportunidad para hacerlo y al proceso que se debe seguir para lograr innovaciones desde el rol que cada persona desempeña en la organización.  </p>\r\n\r\n<p>Aprenderemos a validar el problema, entender a las personas que les sucede el problema, identificar las alternativas para dar soluciones y generar nuevas ideas.  </p>\r\n\r\n<p>Lograremos poner a prueba nuestras ideas y validarlas para obtener los resultados deseados.</p>', '<h3>Jackie Yepez </h3>  <p>Coordinadora Comercial y docente de Xlearn; profesional en Administración de Negocios con MBA. Cuenta con más de 20 años de experiencia trabajando en empresas multinacionales, multilatinas, nacionales e internacionales de diferentes sectores de servicios como: Logístico, Farmacéutico y Consumo masivo.</p> ', '[\"https://dashboard.xlearn.com.co/tutores/jackie\"]', 1, '13634950', 0, 'https://dashboard.xlearn.com.co/ruta-image-cursos/experimentar-y-decidir.jpg', NULL, '[1,2,3,4,5]', '/users/177726805/projects/13634950/videos', '2022-11-16 00:43:52', '2022-12-15 02:48:22', 'https://player.vimeo.com/video/772190085?h=a7e643fba1', 4, 3),
(51, 'Entender y Explorar', '<p>En este módulo abordaremos conceptos y herramientas relacionadas al primer paso del proceso de Innovación. Este primer paso lo vamos a denominar “Entender y explorar”.  </p>\r\n\r\n<p>Nuestra primera gran habilidad como innovadores será identificar aquellos retos correctos, los que vale la pena resolver. Si estamos resolviendo los retos correctos, estaremos aportando verdadero valor en nuestro camino de la innovación.  </p>\r\n\r\n<p>Nuestra primera habilidad valiosa como innovadores será resolver los retos correctos, aquellos retos que aportan mayor valor a la organización y, entonces, podremos salir a descubrir todo lo que está alrededor y generar las ideas correctas.  </p>', '<h3>Julián Cardona </h3>   <p>Consultor aliado y docente de Xlearn; MBA Magister en administración de empresas - Universidad EAFIT. Cuenta con más de 13 años de experiencia en la innovación, estrategia y desarrollo de nuevos negocios. </p>', '[\"https://dashboard.xlearn.com.co/tutores/julian\"]', 1, '13634942', 0, 'https://dashboard.xlearn.com.co/ruta-image-cursos/entender-y-explorar.jpg', NULL, '[6,2,8,9,10]', '/users/177726805/projects/13634942/videos', '2022-11-16 00:43:52', '2022-12-15 02:48:23', 'https://player.vimeo.com/video/772185013?h=a7e643fba1', 4, 3),
(52, 'Qué es la innovación', '<p>La innovación es un concepto que, si bien está de moda en el mundo empresarial y casi a diario escuchamos de ella, siempre ha estado vinculado a la humanidad y su instinto de supervivencia, inicialmente, y luego a su deseo de progreso.  </p>\r\n\r\n<p>Grandes innovaciones como la rueda, la agricultura, la aviación, el internet, o un kit portátil para exámenes oculares, han surgido como respuesta del ingenio humano a grandes problemas y retos.</p>\r\n\r\n<p>Si deseamos resultados consistentes, cualquier tipo de organización debería abordar la innovación de manera sistemática. Esto se logra con un proceso que les otorgue la misma importancia a los temas financieros, de mercadeo, logísticos y de producción necesarios para llevar una idea al mercado.</p>\r\n\r\n<p>Un proceso de innovación pasa por cuatro etapas:  </p>\r\n\r\n<div>\r\n    <ul>\r\n        <li>Cuestionar  </li>\r\n        <li>Observar   </li>\r\n        <li>Colaborar</li>\r\n        <li>Experimentar</li>\r\n        <li>Asociar</li>\r\n    </ul>\r\n</div>', '<h3>Daniel Ángel </h3>  <p>Consultor Senior y docente de Xlearn; Doctorado en Gestión de Innovación y Tecnología (en curso) Universidad Pontificia Bolivariana. Cuenta con más de 11 años de experiencia, acompañamiento de 150 empresas y experto en innovación, estrategia, gestión tecnológica y emprendimiento corporativo. </p>', '[\"https://dashboard.xlearn.com.co/tutores/daniel\"]', 1, '13634925', 0, 'https://dashboard.xlearn.com.co/ruta-image-cursos/que-es-la-innovacion.jpg', NULL, '[11,12,13,14,15]', '/users/177726805/projects/13634925/videos', '2022-11-16 00:43:52', '2023-01-12 22:59:57', 'https://player.vimeo.com/video/771658423?h=a7e643fba1', 4, 3),
(53, 'ADN Innovador', '<p>Bienvenidos a este espacio que tiene por objetivo potenciar nuestra capacidad innovadora, que existe en algún grado en toda persona.  </p>\r\n\r\n<p>Aprenderemos ¿Por qué y para qué innovar? ¿Cómo podemos ser personas más innovadoras? Para poder lograr esto tenemos que desarrollar un equipaje especial y ese equipaje tiene debe buscar un lugar para desarrollarlo; este espacio será nuestra organización.  </p>\r\n\r\n<p>El objetivo es desarrollar nuestra capacidad innovadora a partir de 5 habilidades clave:  </p>\r\n\r\n<div>\r\n    <ul>\r\n        <li>Cuestionar  </li>\r\n        <li>Observar   </li>\r\n        <li>Colaborar</li>\r\n        <li>Experimentar</li>\r\n        <li>Asociar</li>\r\n    </ul>\r\n</div>\r\n\r\n<p>Finalmente, lograremos desarrollar las capacidades para analizar integralmente el entorno de negocio de la temática de interés y definir un foco de negocio con una base de datos objetiva.   </p>', '<h3>Christian Paeres  </h3>   <p>Consultor Senior y docente de Xlearn; Máster en Gestión de la innovación Empresarial Universidad de Barcelona - EAE- OBS. Cuenta con más de 7 años de experiencia en la unidad de Transformación Digital y negocios EdTech de 10X, director de operaciones, y  ha intervenido más de 100 empresas durante su experiencia como consultor.</p>  <h3>Elizabeth Franco</h3>   <p>Directora de Mercadeo  y docente de Xlearn; Máster en Dirección de Comunicación Corporativa - OBS Business School. Cuenta con más de 10 años de experiencia en el campo, además, ha trabajado en las comunicaciones de proyectos de alto impacto como Seminario de Innovación (Ruta N), MEGAe (INNpulsa Colombia), Innovación para todos (Ruta N), entre otros.</p>', '[\"https://dashboard.xlearn.com.co/tutores/chris\", \"https://dashboard.xlearn.com.co/tutores/eli\"]', 1, '13634903', 0, 'https://dashboard.xlearn.com.co/ruta-image-cursos/ADN-innovacion.jpg', NULL, '[21,22,23,24,1]', '/users/177726805/projects/13634903/videos', '2022-11-16 00:43:52', '2022-12-15 02:48:26', 'https://player.vimeo.com/video/771721849?h=1db7d20906', 4, 3),
(54, 'Presentaciones efectivas', '<p>En este curso construiremos una estructura de presentación básica que servirá para ordenar la información que vamos a presentar de nuestro proyecto. </p>\r\n\r\n<p>Es recomendable que esta herramienta la usemos como guía, pero una vez completada es necesario darle identidad con nuestro proyecto.  </p>\r\n\r\n<p>Es decir, usaremos colores, estilo de diseño, palabras, imágenes, entre otros elementos que nos permitan diferenciarnos sustancialmente de cualquier presentación cotidiana de nuestra organización. </p>\r\n\r\n<p>Cuando sea posible, nuestro proyecto debe ser tratado como si fuera una empresa completamente independiente de la organización a la cual pertenecemos, por lo tanto, deberá tener su propia identidad gráfica, comunicacional, nombre, logo, etc. Es válido usar cualquier elemento que permita que seamos recordados y diferenciados de los demás.  </p>', '<h3>Felipe Restrepo </h3>   <p>CEO, cofundador, consultor y docente de Xlearn; Máster en Gestión de Ciencia,  Tecnología e Innovación y Profesional en Administración de Empresas. Cuenta con más de 12 años de experiencia consultor en innovación, desarrollo tecnológico y emprendimiento; ha impulsado a altas direcciones de empresas reconocidas del país hacia el crecimiento permanente, desde la innovación. </p>', '[\"https://dashboard.xlearn.com.co/tutores/felipe\"]', 1, '13635054', 0, 'https://dashboard.xlearn.com.co/ruta-image-cursos/presentacion-efectiva-de-negocios.jpg', '[19]', '[16,17,18,19,20]', '/users/177726805/projects/13635054/videos', '2022-11-16 00:43:53', '2022-12-15 02:48:29', 'https://player.vimeo.com/video/748887417?h=a7e643fba1', 4, 4),
(55, 'Prototipado', '<p>En este curso desarrollaremos un prototipo de nuestra idea de negocio, que nos servirá para comunicarla a clientes potenciales y recibir su retroalimentación.  </p>\r\n\r\n<p>Una técnica muy útil para crear prototipos de ideas de negocios es la “landing page”, o página de aterrizaje. Esta técnica consiste en crear un sitio web que contiene la información mínima necesaria para que una persona entienda una idea de negocio y se motive a querer conocer o investigar más. Revisaremos los contenidos que debemos crear para cada sección de la landing page y luego, veremos cómo subirlos a internet y crear nuestro propio sitio web usando la herramienta gratuita Google Sites. </p>\r\n\r\n<p>Los acompañaremos a lo largo de todo el proceso, realizando el ejercicio paso a paso con un caso ejemplo. Este caso consistirá en una empresa que vende planes alimenticios para ciclistas, que hemos llamado Power Eat.  </p>\r\n\r\n<p>Con este proyecto lograremos desarrollar la capacidad de contar nuestra idea de negocio de una forma corta y visual, que resulte atractiva para un cliente potencial.  </p>\r\n\r\n<p>La landing page que tendremos al final será un excelente instrumento para validar con estos clientes potenciales su posible interés en nuestra solución, y que nos den una retroalimentación valiosa con sus preguntas, críticas constructivas, e ideas.  </p>\r\n\r\n<p>Esto fortalecerá nuestra solución y nos ayudará a prepararnos para los pasos siguientes en el desarrollo de nuestro nuevo negocio.  </p>', '<h3>Pedro Sanín </h3>   <p>Cofundador y consultor de Blaster Desing Studio; ha participado en el diseño y desarrollo de negocios, productos, servicios y espacios por más de 11 años. Contribuye con la transformación de emprendimientos y empresas a través del diseño y la innovación. </p>', '[\"https://dashboard.xlearn.com.co/tutores/pedro\"]', 1, '13635041', 0, 'https://dashboard.xlearn.com.co/ruta-image-cursos/prototipado.jpg', '[7,8,9]', '[25,26,27,28,29]', '/users/177726805/projects/13635041/videos', '2022-11-16 00:43:53', '2022-12-15 02:48:31', 'https://player.vimeo.com/video/771701679?h=4da33d8d8c', 4, 4),
(56, 'Modelación de negocios', '<p>Al momento de pensar en la modelación de un negocio, debemos analizar los elementos más relevantes para realizar declaraciones estratégicas que, en un futuro cercano, cuando el negocio esté en el mercado, faciliten la definición de actividades y recursos clave a nivel táctico y operativo.  </p>\r\n\r\n<p>Sin embargo, sin un método claro, la modelación de negocio puede resultar un reto, por lo cual en los últimos años han surgido un sinfín de herramientas que tienen como propósito brindar un paso a paso más simple que las técnicas aplicadas anteriormente.  </p>\r\n\r\n<p>Algunas de estas herramientas son: </p>\r\n\r\n<div>\r\n    <ul>\r\n        <li>Plan Cruncher </li>\r\n        <li>Lean canvas</li>\r\n        <li>Business model canvas</li>\r\n        <li>Board of innovation</li>\r\n        <li>Entre otras.</li>\r\n    </ul>\r\n</div>\r\n\r\n<p>Pero nos preguntaremos ¿Cuál es la mejor? La respuesta es depende, cada una de ellas ofrece variados beneficios para los negocios que se encuentran en diferentes momentos de desarrollo. </p>\r\n \r\n<p>En este curso abordaremos la herramienta Innovator Canvas, la cual nos permitirá entender los elementos estratégicos de cara al mercado, los cuales direccionarán actividades, recursos y aliados clave. Al final, lograremos dimensionar la oportunidad detrás de la iniciativa de negocio.  </p>', '<h3>Jackie Yepez </h3>   <p>Coordinadora Comercial y docente de Xlearn; profesional en Administración de Negocios con MBA. Cuenta con más de 20 años de experiencia trabajando en empresas multinacionales, multilatinas, nacionales e internacionales de diferentes sectores de servicios como: Logístico, Farmacéutico y Consumo masivo. </p>', '[\"https://dashboard.xlearn.com.co/tutores/jackie\"]', 1, '13635036', 0, 'https://dashboard.xlearn.com.co/ruta-image-cursos/modelacion-de-negocios.jpg', '[6,10,11,12,13,14,15,16,17,18,20]', '[30,31,32,33,34]', '/users/177726805/projects/13635036/videos', '2022-11-16 00:43:53', '2022-12-15 02:48:33', 'https://player.vimeo.com/video/748886983?h=03c6f532d8', 4, 4),
(57, 'Diseño de propuesta de valor', '<p>En este curso, continuaremos diseñando nuestra iniciativa de negocio a través del entendimiento y la aplicación de la herramienta principal del curso “Concepto de oferta y propuesta de valor”, la cual nos permitirá perfilar los clientes potenciales identificando sus motivaciones, dolores y anhelos, los cuales se convertirán en un insumo clave para la creación de una solución con un conjunto de atributos diferenciadores que serán validados de la mano del mercado. </p>\r\n\r\n<p>Buscaremos diseñar y testear la propuesta de valor del negocio en función del resultado de las validaciones con el mercado y el análisis del entorno competitivo. </p>\r\n\r\n<p>La herramienta principal que abordaremos durante este curso nos permitirá diseñar una propuesta de valor desde dos enfoques: el perfil del cliente, donde se describen los principales objetivos que intentan cumplir relacionados con la necesidad que desean atender; además de las problemáticas y deseos que vive el cliente potencial cuando intenta cumplir dichos objetivos. </p>\r\n\r\n<p>El segundo enfoque, es el mapa de valor o el perfil de la empresa, donde se especifican los detalles de la oferta y los atributos diferenciadores de la misma. </p>\r\n\r\n<p>Al final, lograremos diseñar conceptos de oferta y propuestas de valor que le cambien la vida a los clientes potenciales a través de los atributos diferenciales de la oferta. (Gráfico del perfil (Trabajos, Anhelos y dolores) - texto y del mapa de valor (descripción producto y servicio, mitigadores de dolor, creadores de anhelos- texto). </p>\r\n', '<h3>Óscar López</h3>   <p>Consultor Senior y docente de Xlearn; Magíster y profesional en Ingeniería Química. Cuenta con más de 6 años de experiencia ayudando a clientes de diferentes sectores industriales como el químico, metalmecánico, alimentos, automotriz, seguros, TI, entre otros. </p>', '[\"https://dashboard.xlearn.com.co/tutores/oscar\"]', 1, '13635031', 0, 'https://dashboard.xlearn.com.co/ruta-image-cursos/diseno-de-propuesta-de-valor.jpg', '[1,2,3,4]', '[8,35,36,37,38]', '/users/177726805/projects/13635031/videos', '2022-11-16 00:43:53', '2022-12-15 02:48:36', 'https://player.vimeo.com/video/748886668?h=559e7e472e', 4, 4),
(58, 'Análisis estratégico del entorno', '<p>A lo largo del curso desarrollaremos una herramienta llamada Foco de Negocio que nos permitirá definir el foco de negocio y sintetizar los resultados clave del análisis del entorno.  </p>\r\n\r\n<p>El Foco de Negocio resume los hallazgos más importantes de cada lección. </p>\r\n\r\n <p>En la primera lección, la creación del ecosistema de oportunidades, analizaremos el panorama el de todas oportunidades de negocio recolectando primeros datos del entorno del que alimentan el componente de tendencias, cifras y referentes. Iremos profundizando en los elementos en el transcurso de las lecciones de selección de oportunidades de negocio y análisis de las 4A. </p>\r\n\r\n<p>El objetivo es que lleguemos al final del curso con los conceptos claros sobre el Foco de Negocio y que reflejen el análisis del entorno de hasta las 2 oportunidades de negocio y, con ello, podremos priorizar y definir los datos objetivos y vincularlos a la visión estratégica de la organización, es decir, el foco del negocio.  </p>\r\n\r\n<p>Finalmente, lograremos desarrollar las capacidades para analizar integralmente el entorno de negocio de la temática de interés y definir un foco de negocio con una base de datos objetiva.  </p>', '<h3>Félix Cárdenas</h3>   <p>Consultor Senior y docente de Xlearn; Máster en Gestión de la Ciencia, la Tecnología y la Innovación y Profesional en Negocios Internacionales. Cuenta con más de 8 años de experiencia en posiciones de liderazgo, gerencia y consultoría a empresas, universidades y entidades públicas. </p>', '[\"https://dashboard.xlearn.com.co/tutores/felix\"]', 1, '13635027', 0, 'https://dashboard.xlearn.com.co/ruta-image-cursos/analisis-estrategico.jpg', '[5]', '[55,56,57,58,59]', '/users/177726805/projects/13635027/videos', '2022-11-16 00:43:53', '2022-12-15 02:48:39', 'https://player.vimeo.com/video/748886113?h=ab47d3cdbe', 4, 4),
(59, 'Desarrollo de nuevos negocios', '<p>Desde la premisa de que cada uno de nosotros tiene el chip de la innovación incorporado, hasta ahora hemos recorrido un camino que involucra tanto a las personas que lo han reconocido, o se están dando la oportunidad para hacerlo y al proceso que se debe seguir para lograr innovaciones desde el rol que cada persona desempeña en la organización.  </p>\r\n\r\n<p>Aprenderemos a validar el problema, entender a las personas que les sucede el problema, identificar las alternativas para dar soluciones y generar nuevas ideas.  </p>\r\n\r\n<p>Lograremos poner a prueba nuestras ideas y validarlas para obtener los resultados deseados.</p>', '<h3>Jackie Yepez </h3>  <p>Coordinadora Comercial y docente de Xlearn; profesional en Administración de Negocios con MBA. Cuenta con más de 20 años de experiencia trabajando en empresas multinacionales, multilatinas, nacionales e internacionales de diferentes sectores de servicios como: Logístico, Farmacéutico y Consumo masivo.</p> ', '[\"https://dashboard.xlearn.com.co/tutores/jackie\"]', 1, '13635018', 0, 'https://dashboard.xlearn.com.co/ruta-image-cursos/introduccion-NN.jpg', NULL, '[60,61,62,63,64]', '/users/177726805/projects/13635018/videos', '2022-11-16 00:43:53', '2022-12-21 20:30:23', 'https://player.vimeo.com/video/772190085?h=a7e643fba1', 4, 4);
