(234, 'Xlearn es una plataforma especializada en consultoría y contenido de innovación y emprendimiento corporativo, en la cual podrás desarrollar tus proyectos empresariales, entrenar a tus equipos y generar estrategias para el éxito de tu negocio, fortalecimiento del capital humano y desarrollo de las capacidades instaladas de la organización.', '', 74, NULL, '2022-11-25 15:45:36', '2022-11-25 15:45:36'),
(235, 'Los cursos están compuestos por material audiovisual, recursos y herramientas que permiten que tus proyectos y entrenamientos sean desarrollados de manera efectiva y en los tiempos requeridos.\r\n\r\nCada curso cuenta con: nivelación (conocimientos básicos para desarrollar el curso), proyecto (elaboración de una herramienta paso a paso de acuerdo al contenido propuesto), Introducción (explicación general del tema), y lecciones (cada uno de los puntos clave del tema a desarrollar divididos en pequeñas cápsulas).', '', 75, NULL, '2022-11-25 15:47:54', '2022-11-25 15:47:54'),
(236, 'El primer paso es registrarte, adquiere tu suscripción y comienza a interactuar con la plataforma, explora el contenido, revisa las herramientas y recursos que te ayudarán en tu proceso de aprendizaje.', '', 76, NULL, '2022-11-25 15:47:54', '2022-11-25 15:47:54'),
(237, 'Determina las necesidades de tu organización y establece los focos centrales que son necesarios para iniciar con el entrenamiento; para realizar un proyecto, verifica el estado en el que se encuentra y establece la ruta de aprendizaje que consideres más apropiada en este proceso.', '', 77, NULL, '2022-11-25 15:47:54', '2022-11-25 15:47:54'),
(238, 'Ingresa aquí, completa tus datos de registro y comienza a explorar la plataforma Xlearn.', '', 78, NULL, '2022-11-25 15:47:54', '2022-11-25 15:47:54'),
(239, 'Xlearn es una plataforma especializada en consultoría y contenido de innovación y emprendimiento corporativo, en la cual podrás desarrollar tus proyectos empresariales, entrenar a tus equipos y generar estrategias para el éxito de tu negocio, fortalecimiento del capital humano y desarrollo de las capacidades instaladas de la organización.', '', 79, NULL, '2022-11-25 15:47:54', '2022-11-25 15:47:54'),
(240, 'Puedes acceder a todo el contenido disponible en nuestra plataforma, tendrás unos cursos asignados pero también puedes realizar los cursos de tu interés.', '', 80, NULL, '2022-11-25 15:47:54', '2022-11-25 15:47:54'),
(241, 'Al finalizar tu entrenamiento o proyecto, obtendrás un certificado de culminación de cada uno de los cursos realizados.', '', 81, NULL, '2022-11-25 15:47:54', '2022-11-25 15:47:54'),
(242, 'El certificado lo obtendrás una vez realices todos los cursos asignados a la ruta de aprendizaje específica según las necesidades tu proyecto o entrenamiento. Cada vez que culmines algún curso podrás descargar tu certificado o enviarlo al correo electrónico correspondiente.', '', 82, NULL, '2022-11-25 15:47:54', '2022-11-25 15:47:54'),
(243, 'Una vez finalizado el curso o la ruta de aprendizaje, te aparecerá un botón directo a la descarga de tu certificado; también lo podrás enviar directo a tu correo electrónico.', '', 83, NULL, '2022-11-25 15:48:08', '2022-11-25 15:48:08'),
(244, 'Podrás ver el progreso de tus equipos en los entrenamientos y avances en los proyectos en la pestaña de Reportes que encontrarás en tu perfil una vez ingreses con los datos relacionados a tu cuenta de Xlearn ¿Ya te registraste? Si no lo has hecho ingresa aquí y comienza a explorar nuestra plataforma.', '', 84, NULL, '2022-11-25 15:48:21', '2022-11-25 15:48:21'),
